import React, { useState, useEffect } from 'react';
import {liquorList} from './LiquorData'
export default function LiquorList() {
  const [items, setItems] = useState([]);

  useEffect(() => {
    console.log('LiquorList useEffect fired');
    fetch('http://localhost:8080/api/inventory')
      .then(res => {
        console.log('Fetch response status:', res.status);
        return res.json();
      })
      .then(data => {
        console.log('Fetched data:', data);
        setItems(data);
      })
      .catch(err => console.error('Fetch error:', err));
  }, []);

  return (
    <section className='liquor-grid'>

      {
        items.map(({id, name, containerType, abv, quantity, image, volume })=>{


            console.log('Rendering image for', name, 'from', image);

            return  (

          <div key={id} className='=liquor-card'>


            {image &&
            
            <img src={image} alt={name} className='liquor-card__img'>
              
              </img>}

              <h3 className='liquor-card__name'>{name}</h3>
              <p>Container: {containerType}</p>
              {volume && <p>Volume: {volume}</p>}
              <p>ABV: {abv}%</p>
              <p>Qty: {quantity}</p>
          </div>
        )



        }
       
        )
      }

    </section>
  );
}
